import React, { useState } from "react";
import Home from "../pages/Home";
import Login from "../pages/Login";
import {
  AppBar,
  Button,
  Tab,
  Tabs,
  Toolbar,
  Typography,
  Link,
  useMediaQuery,
  useTheme,
} from "@mui/material";
const Header = () => {
  const [value, setValue] = useState();
  const theme = useTheme();
  return (
    <>
      <AppBar>
        <Toolbar>
          <Typography variant="h5" to="/" align="left">
            Employer
          </Typography>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
